import React, { Component } from 'react';
import { NavLink } 			from 'react-router-dom';
import { Head5 } 			from '../styles/Head5'
import Title				from '../components/Title';
import { FaLaptopCode, FaPaintBrush, FaDatabase} from 'react-icons/fa'

import { followData } from "../data/followData";

export default class followIcon extends Component {

	state = {
		follows: followData
	};

	render() {
	    return (

	      <section> 	        
	        <div className="how-portfolio">
                <ul>
            	  {this.state.follows.map((item, index) => {
              		return (
              		<article>
              		  <li key={index} className="portfolio">
              		  <span className="nav-link">{item.icon}</span>
						<a className="nav-link p-project" href={item.source_url} 
		    			   target="_blank" rel={item.rel}> {item.name}                          
                        </a>     		  	
              			<h6 className="nav-link">{item.title}</h6>
                  		<Head5> {item.detail}</Head5>
              		  </li>
              		</article>
              		);
            	  })}
                </ul>       
	        </div>
	      </section>

		);
  	}
}
